import { BrowserRouter, Route, Link, Router } from "react-router-dom";
import Navbar from './components/Navbar';
import About from './components/Pages/About';

function App(){
  return(
    <div>
    <Navbar>
    <div className="container-fluid p-0">
    <Router >
      <Route path="/about"
        component={About}
      />
    </Router>
    </div>
    </Navbar>
    </div>
  );
};

export default App;
